import React, { useState } from 'react';

function ExpenseFilter() {
    
    const [chosenDate, setChosenDate] = useState('');
    
    return(
        <form>
            <div></div>
        <input type='date' min='2019-01-01' max='2023-12-31'
                value={chosenDate}></input>
        </form>
    );
};

export default ExpenseFilter();
